INSERT INTO `comments` (`created_at`, `updated_at`, `state`, `comment_id`, `comment`, `created_by`, `post_id`, `user_id`) VALUES
('2023-11-06 19:54:35.223167', '2023-11-06 19:54:35.223167', 1, 1, 'Este es el primer comentario en todo mi proyecto', 'brosario', 4, 'brosario'),
('2023-11-07 00:51:23.552328', '2023-11-07 00:51:23.553325', 1, 2, 'Mi segundo comentario', 'brosario', 4, 'brosario'),
('2023-11-07 00:51:52.876617', '2023-11-07 00:51:52.876617', 1, 3, 'Mi segundo comentario', 'brosario', 4, 'brosario'),
('2023-11-07 01:08:27.802978', '2023-11-07 01:08:27.802978', 1, 4, 'El plástico puede tardar miles de años en descomponerse y hasta entonces es capaz de contaminarlo todo a su paso. Con el tiempo, estos materiales tienden a fragmentarse en pequeños trozos minúsculos que son prácticamente invisibles al ojo humano y que son conocidos como microplásticos. Estas pequeñas partículas se han convertido en alimento de miles de especies marinas lo que provoca que estos contaminantes hayan entrado de lleno en nuestra cadena alimenticia.', 'kmarie', 4, 'kmarie'),
('2023-11-07 03:18:55.250757', '2023-11-07 03:18:55.250757', 1, 5, 'National Geographic se compromete a reducir la contaminación por plásticos. Este artículo es parte de ¿Planeta o Plástico?, nuestro esfuerzo plurianual para crear conciencia sobre la crisis de los desechos plásticos.', 'kmarie', 1, 'kmarie'),
('2023-11-07 13:23:51.441344', '2023-11-07 13:23:51.441344', 1, 6, 'Este es un tema que a pocas personas les interesa pero que es muy importante, debemos tomar conciencia sobre los efectos negativos que provocamos en el medio ambiente', 'fenixfl1', 1, 'fenixfl1'),
('2023-11-08 01:02:30.986949', '2023-11-08 01:02:30.986949', 1, 7, 'Fue en los años 50 cuando se produjo el mayor auge de producción de plásticos de nuestra historia llegando a superar la producción de cualquier otro tipo de material. Gracias a su bajo coste y su fácil producción, el uso de plásticos en la industria nos permitió realizar importantes avances en diferentes ámbitos de nuestra sociedad, por ejemplo, en el transporte.', 'jcabrera', 4, 'jcabrera');

