INSERT INTO `posts` (`created_at`, `updated_at`, `state`, `post_id`, `title`, `content`, `is_approved`, `author`, `created_by`, `front_page`) VALUES
('2023-10-21 04:24:35.439673', '2023-10-21 04:24:35.439673', 1, 1, 'Idea para reciclar desechos organicos', '<h1>Nuestra adicción al plástico y su terrible impacto en nuestro planeta</h1><p><a href=\"https://www.ngenespanol.com/author/melissa/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgba(0, 0, 0, 0.4);\">MELISA VELÁZQUEZ</a></p><p>7 ENERO, 2021</p><p><img src=\"https://dam.ngenespanol.com/wp-content/uploads/2021/01/que-son-los-plasticos-770x513.jpg\"></p><h2>Te contamos qué son los plásticos, sus tipos y cómo reciclarlos para contrarrestar el terrible impacto que están causando en nuestro planeta.</h2><p>Así fue como los&nbsp;plásticos,&nbsp;desechables&nbsp;y prácticos, se apoderaron de nuestra vida cotidiana, y así es como podríamos eliminar este hábito, por el bien del planeta.</p><p><br></p><h2>¿Qué son los plásticos?</h2><p>A primera vista sería difícil identificar qué tienen en común los cepillos de dientes, las llantas, los cigarrillos y los zapatos.</p><p>Pero, si ponemos atención, descubriremos que, como muchos objetos de nuestra vida cotidiana, están hechos en mayor o menor medida del mismo material milagroso:&nbsp;plástico.</p><p>Está compuesto por resinas, proteínas y otras sustancias quñimicas que son fáciles de manipular y moldear, hasta que con cierta compresión y temperatura, se obtiene un objeto sólido de gran utilidad.&nbsp;Este material hoy es un problema global.</p><p>Te puede interesar:&nbsp;<a href=\"https://www.ngenespanol.com/el-mundo/sudeste-asiatico-parte-del-mundo-se-produce-mas-plastico/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(51, 51, 51);\"><strong>¿En qué parte del mundo se produce más plástico?</strong></a></p><h2>¿Por qué los plásticos son un problema para el planeta?</h2><p>Cuando el&nbsp;plástico&nbsp;se mezcla con otras sustancias, entre ellas, otros plásticos, como en los zapatos, es difícil o imposible reciclarlo.</p><p>En muchos lugares no es posible reciclarlo, incinerarlo o desecharlo en un vertedero, por no mencionar los otros desechos que terminan en ríos y mares.</p><p>En general, tras una breve vida útil, a los artículos de plástico les esperan siglos de existencia como basura. Terminan en los ríos y en el mar. Se convierten en trozos diminutos llamados microplásticos.</p><p>Criaturas marinas de todos los tamaños se alimentan de esas partículas. Se mezclan con sal de mar y terminamos comiéndolas, y los efectos de esto todavía son inciertos.</p><p>Te puede interesar:&nbsp;<a href=\"https://www.ngenespanol.com/ecologia/5-cifras-contaminacion-por-plasticos-mundo/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(51, 51, 51);\"><strong>5 cifras alarmantes sobre la contaminación por plásticos en el mundo</strong></a></p><p><img src=\"https://dam.ngenespanol.com/wp-content/uploads/2021/01/efecto-del-plastico-en-el-planeta-300x300.jpg\">Foto: Pexels</p><p>Respiramos partículas aún más diminutas, llamadas nanoplásticos. En fechas recientes, científicos las encontraron en la cima de montañas remotas e incluso en el Ártico, hasta donde las arrastra el viento y se mezclan con lluvia y nieve. El milagro se ha vuelto una pesadilla.</p><h2>El llamado a reciclar los plásticos</h2><p>El reto creciente es tener el primero sin la segunda. Desde hace medio siglo, la respuesta de los ambientalistas ha sido “reduce, reutiliza y recicla”.</p><p>No obstante, los comercios que manejan productos de plástico o embalaje tienen pocos incentivos para alentar la reducción o reutilización, y reciclar, alguna vez la panacea, puede ser complicado y costoso.</p><p>La&nbsp;contaminación plástica&nbsp;es un problema global, así que es mucho lo que está en juego y la conciencia del público es cada vez mayor. Parece que se gesta un cambio cultural.</p><p>Te puede interesar:&nbsp;<a href=\"https://www.ngenespanol.com/ecologia/greenpeace-10-empresas-generan-mas-plastico/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(51, 51, 51);\"><strong>Greenpeace revela el ranking de las 10 empresas que generan más plástico</strong></a></p><p>Los&nbsp;desperdicios plásticos&nbsp;nos empiezan a preocupar. Emprendedores crean alternativas para evitarlos. El punto no es satanizar aquello que se inventó por un buen motivo y con buenas intenciones, sino encontrar el modo de aprovechar el plástico sin excesos.</p><p>Cada faceta en la que ha intervenido el plástico representa un reto distinto. Cada objeto tiene una historia. A continuación, algunas de estas historias y sus soluciones.</p><h2>Tipos de plásticos y cómo reciclarlos</h2><p>National Geographic&nbsp;se compromete a reducir la contaminación por plásticos. Este artículo es parte de ¿Planeta o Plástico?, nuestro esfuerzo plurianual para crear conciencia sobre la crisis de los desechos plásticos.</p><p>Descubre qué puedes hacer para reducir tu consumo de plásticos de un solo uso y comprométete.</p><p>Te puede interesar:&nbsp;<a href=\"https://www.ngenespanol.com/ciencia/cuantos-microplasticos-ingerimos-ano/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(51, 51, 51);\"><strong>¿Cuántos microplásticos ingerimos al año?</strong></a></p><h2>Tereftalato de polietileno o PET (botellas de plástico)</h2><p>De todos los productos de plástico, las botellas para bebidas destacan por lo rápido que se volvieron universales y cambiaron los hábitos de consumo de bebidas.</p><p>El&nbsp;tereftalato de polietileno, o&nbsp;PET, lo cambió todo: las&nbsp;botellas de PET&nbsp;eran ligeras y reducían los costos de transporte, pero también eran resistentes y mantenían las bebidas gasificadas.</p>', 1, 'brosario', 'brosario', 'data:image/webp;base64,');
