('2023-10-21 04:26:02.006153', '2023-10-21 04:26:02.006153', 1, 2, '10 ideas para reciblar desechos no bio degradables', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.', 1, 'brosario', 'brosario', 'data:image/webp;base64,');
INSERT INTO `posts` (`created_at`, `updated_at`, `state`, `post_id`, `title`, `content`, `is_approved`, `author`, `created_by`, `front_page`) VALUES
('2023-10-26 05:37:27.760723', '2023-10-26 05:37:27.760723', 1, 4, 'Eliminar los plásticos para salvar el planeta', '<p>“Aquellos que no pueden recordar el pasado están condenados a repetirlo”. Esta famosa cita del poeta George Santayana nos lleva a pensar que es necesario tomar conciencia de nuestras acciones para no repetir los mismos errores. Y es que si no tomamos medidas contra la crisis climática debemos empezar a olvidarnos de que la vida en nuestro planeta sea posible.</p><p>El último informe de&nbsp;<strong>ONU Medio Ambiente</strong>&nbsp;ya revela que, si nuestras acciones no cambian, nuestro planeta se convertirá en un hábitat prácticamente insostenible. Quizás sea difícil saber qué hacer o por donde empezar, pero desde las organizaciones internacionales lo tienen claro: eliminar los plásticos para reducir una de las principales fuentes de contaminación del&nbsp;<a href=\'https://www.fundacionaquae.org/que-es-el-agua/\' rel=\'noopener noreferrer\' target=\'_blank\' style=\'color: rgb(0, 158, 227);\'>agua</a>.</p><p>“Es fundamental tener un planeta sano para que el futuro sea próspero y pacífico. Todos debemos contribuir a proteger nuestro único hogar” asegura Antonio Guterres, secretario general de Naciones Unidas.</p><p><br></p><h2><strong>Eliminar los plásticos del mar y aire&nbsp;</strong></h2><p>El plástico es uno de los grandes problemas ambientales y una de nuestras mayores pesadillas en los últimos tiempos. Y es que estas partículas están presentes en todos los aspectos de nuestra vida: en el aire que respiramos, el&nbsp;<a href=\'https://www.fundacionaquae.org/cuanta-agua-beber-dia/\' rel=\'noopener noreferrer\' target=\'_blank\' style=\'color: rgb(0, 158, 227);\'>agua que bebemos</a>&nbsp;y la comida que ingerimos.</p><p>Cerca de<strong>&nbsp;13 millones de toneladas de desechos plásticos</strong>&nbsp;acaban en vertederos y en nuestros océanos. Tan solo una pequeña fracción se reciclan. Esto supone un grave problema para el medio ambiente. La ONU ya afirma que&nbsp;<strong>si esta situación no cambia en 2050 existirán cerca de 1.200 millones de toneladas de desechos plásticos en el mundo</strong>. Más plásticos que peces en el mar.</p><p>Fue en los años 50 cuando se produjo el mayor auge de producción de plásticos de nuestra historia llegando a superar la producción de cualquier otro tipo de material. Gracias a su bajo coste y su fácil producción, el uso de plásticos en la industria nos permitió realizar importantes avances en diferentes ámbitos de nuestra sociedad, por ejemplo, en el transporte.</p><p>A pesar de su gran valor para el progreso de la industria, su producción masiva ha supuesto la creación de un problema ambiental que ha alcanzado niveles extremadamente preocupantes. Revertir esta situación y eliminar los plásticos es ya una prioridad para salvar nuestra salud y la del planeta.</p><p>El plástico puede tardar miles de años en descomponerse y hasta entonces es capaz de contaminarlo todo a su paso. Con el tiempo, estos materiales tienden a fragmentarse en pequeños trozos minúsculos que son prácticamente invisibles al ojo humano y que son conocidos como microplásticos. Estas pequeñas partículas se han convertido en alimento de miles de especies marinas lo que provoca que estos contaminantes hayan entrado de lleno en nuestra cadena alimenticia.</p>', 1, 'brosario', 'brosario', 'data:image/jpeg;base64,');

